from collections import defaultdict

def trace_occurrence(arr, depth=1, occurDict=None):
    """Trace the occurrence of all unique numbers in a complex three-dimensional array"""
    if depth > 5:
        return occurDict
    if occurDict is None:
        occurDict = defaultdict(int)
    if isinstance(arr, (list, tuple)):
        for item in arr:
            trace_occurrence(item, depth + 1, occurDict)
    else:
        occurDict[arr] += 1
    return occurDict

